webpackJsonp([0xca9862ba6b7e],{4213:function(e,i){e.exports={data:{markdownRemark:{frontmatter:{block:"Responsive Web Design Projects"},html:'<h2>Introduction to the Responsive Web Design Projects</h2>\n<p>是时候把你新学到的技能付诸实践了！通过接下来的项目，你将有机会实践你目前所学的所有技能，原理和概念，HTML，CSS，可视化设计，辅助功能等。</p>\n<p>在本节中，你有机会去：</p>\n<ul>\n<li>搭建致敬页</li>\n<li>搭建调查表格</li>\n<li>搭建产品主页</li>\n<li>搭建技术文档页面</li>\n<li>搭建个人作品集网页</li>\n</ul>\n<p>完成这几个项目之后，你可以部署到网站上展示给周围的人。如果你在完成的过程中遇到问题，记得使用 <a href="https://forum.freecodecamp.one/t/topic/157">Read-Search-Ask</a>。</p>'},allChallengeNode:{edges:[{node:{fields:{slug:"/responsive-web-design/responsive-web-design-projects/build-a-tribute-page"},title:"Build a Tribute Page"}},{node:{fields:{slug:"/responsive-web-design/responsive-web-design-projects/build-a-survey-form"},title:"Build a Survey Form"}},{node:{fields:{slug:"/responsive-web-design/responsive-web-design-projects/build-a-product-landing-page"},title:"Build a Product Landing Page"}},{node:{fields:{slug:"/responsive-web-design/responsive-web-design-projects/build-a-technical-documentation-page"},title:"Build a Technical Documentation Page"}},{node:{fields:{slug:"/responsive-web-design/responsive-web-design-projects/build-a-personal-portfolio-webpage"},title:"Build a Personal Portfolio Webpage"}}]}},pathContext:{block:"responsive-web-design-projects",slug:"/responsive-web-design/responsive-web-design-projects"}}}});
